import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <div>
        <nav>
            <ul>
                <li>
                    <Link to='/'>Home</Link>
                </li>
                <li>
                    <Link to='/login'>Login</Link>
                </li>
                <li>
                    <Link to='/apaLst'>Apartment list</Link>
                </li>
            </ul>
        </nav>
        
    </div>
  );
}

export default Navbar;
